import React, {useReducer} from 'react';

const Test = () => {
	const initialState = {
		items: [],
	};
	const reducer = (state, action) => {
		if (action.type === 'add') {
			console.log('add done');
		}
	};
	const [state, dispatch] = useReducer(reducer, initialState);
	return (
		<div>
			<button className="btn btn-block btn-info m-t-10" onClick={() => dispatch({type: 'add'})}>
				action
			</button>
		</div>
	);
};

export default Test;
